INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 1, 10024, 6, 1, 2, 133401, "2024/12/22 14:59:59", "2024/09/15 15:00:00", -470.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2002, "ミーア", 2.88);
