INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10026, 7, 1, 1, 133002, "2025/03/22 14:59:59", "2024/12/15 15:00:00", -470.0, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 2002, "グレイス", 1.78);
