INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10030, 8, 1, 1, 136902, "2025/06/23 14:59:59", "2025/03/15 15:00:00", -470.0, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 2002, "ルルィ", 5.53);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 9, 10031, 8, 2, 7, 136902, "2025/06/23 14:59:59", "2025/03/15 15:00:00", -470.0, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 2002, "ルルィ", 6.05);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10032, 8, 1, 1, 137001, "2025/06/23 14:59:59", "2025/03/15 15:00:00", -470.0, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 2002, "デュラン", 0.0);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10033, 8, 2, 1, 137001, "2025/06/23 14:59:59", "2025/03/15 15:00:00", -470.0, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 2002, "デュラン", 0.0);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10034, 9, 1, 2, 135902, "2025/09/23 14:59:59", "2025/06/16 15:00:00", -470.0, "おう\n好きなもん持ってきな", 2002, "サツキ", 0.0);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 1, 10035, 9, 2, 6, 135902, "2025/09/23 14:59:59", "2025/06/16 15:00:00", -470.0, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 2002, "サツキ", 4.935);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10036, 9, 1, 5, 135802, "2025/09/23 14:59:59", "2025/06/16 15:00:00", -470.0, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 2002, "ユキノ", 7.441);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 7, 10037, 9, 2, 7, 135802, "2025/09/23 14:59:59", "2025/06/16 15:00:00", -470.0, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 2002, "ユキノ", 0.0);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10038, 10, 1, 2, 130901, "2025/12/23 14:59:59", "2025/09/16 15:00:00", -470.0, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 2002, "クルル", 2.295);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 1, 10039, 10, 2, 6, 130901, "2025/12/23 14:59:59", "2025/09/16 15:00:00", -470.0, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 2002, "クルル", 6.281);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 2, 10040, 10, 1, 1, 137701, "2025/12/23 14:59:59", "2025/09/16 15:00:00", -470.0, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 2002, "ヴォルガーノ", 5.549);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 3, 10041, 10, 2, 6, 137701, "2025/12/23 14:59:59", "2025/09/16 15:00:00", -470.0, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 2002, "ヴォルガーノ", 2.64);
